      "uri": "/users/937788",
      "name": "Keiichi Matsuda",
      "link": "https://vimeo.com/chocobaby",
      "location": "London",
      "bio": "Keiichi Matsuda (BSc. MArch) is a designer and film-maker. His research examines the implications of emerging technologies for human perception and the built environment. Keiichi is interested in the dissolving boundaries between virtual and physical, working with video, architecture and interactive media to propose new perspectives on the city. He has exhibited his work internationally, from London\u2019s V&A Museum to the Art Institute of Chicago, the New York MoMA, and Shanghai EXPO. He has been published extensively in print and online, and has won awards for design, drawing, speaking and filmmaking.\n\nHe lives and works in London, and is available for commission.",
