    "name": "Berlin Block Tetris",
    "description": "An animation I made for Uni. Everything is made in After Effects without Plugins. \n\nThe idea is based on a kind of parody of the former Socialist building style. They used to build whole cities where each house was designed identically to create cheap housing for workers.  These \u2018blocks\u2019 were so similar that in Soviet times, you could easily wake up at a friends place in another city and still feel like you are in your flat. Even the furniture was the same.",
