    "name": "Webcam [Short Film]",
    "description": "Someone's watching...\n\n-------------------------------------------------\n\n\"Webcam\" is based on actual events and was shot entirely on a computer's webcam. \nThe filmmakers hope that it will make people think more about the technology that \nwe use every day and the effects it can have on all of us. \n\n::: created & directed by :::\nstefan haverkamp\njan jaworski\nbranden kramer\ntom kropp\n \n::: screenplay by :::\nbranden kramer\n \n::: cast :::\njulia  -               jasmine anne osborne\nmother -          jamie leigh allen\nboyfriend -       thom miller\nhacker -           kent koren\n\n::: editing :::\nlorraine paul\n \n::: sound design :::\njoe philips\n \n::: title design :::\nmcdonald predelus\n \n::: color :::\nsalvatore malfitano\n\n::: executive producer :::\ndee allen",
